import React from 'react'
import { withStyles } from '@material-ui/core/styles'
import { Box} from '@material-ui/core'
import PropTypes from 'prop-types'
import Text from '../text'

const styles = (theme) => ({
    root : {
        display : "flex",
        flexDirection : "column"
    },
    headerWrapper : {
        display : "flex",
        flexDirection : "row",
        justifyContent : "space-between"
    },
    subWrapper : {
        display : "flex",
        flexDirection : "column"
    },
    arrowWrapper : {
        display : "flex",
        flexDirection : "row",
        width : 120,
    },
    leftArrow : {

    }

})

const Carousel = ({ classes, title, subTitle, children }) => {
    return <Box className={classes.root}>
        <Box className={classes.headerWrapper}>
            <Box className={classes.subWrapper}>
                <Box><Text ffamily={"Poppins"} fWeight={500} variant={"body1"} className>{title}</Text></Box>
                <Box><Text ffamily={"Poppins"} fWeight={500} variant={"h6"} color={"#34A76C"}>{subTitle}</Text></Box>
            </Box>
            <Box>
                <Box className={classes.arrowWrapper}>
                    <Box className={classes.leftArrow}/>
                    <Box className={classes.rightArrow} />
                </Box>
            </Box>
        </Box>
        <Box>
            {children}
        </Box>
    </Box>
}

Carousel.propTypes = {
    title : PropTypes.string,
    subTitle : PropTypes.string,
    // eslint-disable-next-line react/forb,id-prop-types
    classes: PropTypes.object.isRequired,
}

export default withStyles(styles)(Carousel)
